/*
 function which promises to gather all the data and dispatch it
 for state rehydration with Async
 */

export default function fetchComponentData(dispatch, components, params) {
  const needs = components.reduce( (prev, current) => {
    return (current.needs || [])
      .concat((current.WrappedComponent ? current.WrappedComponent.needs : []) || [])
      .concat(prev);
  }, []);

  const promises = needs.map(need => dispatch(need(params)));
  return Promise.all(promises);
}

import { fromJS } from 'immutable';
import assign     from 'object-assign';

Object.assign = Object.assign || assign;

// Abstraction to handle pre-composedstate received from server
// (ie, leave top level keys untouched)
export default function immutifyState(obj) {
  let objMut = Object.assign({}, obj);

  Object
    .keys(objMut)
    .forEach(key => {
      objMut[key] = fromJS(objMut[key]);
    });

  return objMut;
}

/*
  Helper for asynchronous actions( dispatcher middleware to transform actions ):
    Keeps actions simple
    Keeps action creators synchronous
    uses promises
 */

/*
 we just define a promise key on our actions and have them automatically resolved and rejected.
 We can also optionally listen in the reducers for auto-generated <TYPE>_REQUEST and <TYPE>_FAILURE
 if we care about mutating state along the way.
 */
function promiseMiddleware() {
  return next => (action) => {
    const { promise, type, ...rest } = action;

    if (!promise) return next(action);

    const SUCCESS = type;
    const REQUEST = `${type}_REQUEST`;
    const FAILURE = `${type}_FAILURE`;

    next({ ...rest, type: REQUEST });

    return promise
      .then((res) => {
        next({ ...rest, res, type: SUCCESS });

        return true;
      })
      .catch((error) => {
        next({ ...rest, error, type: FAILURE });

        // Another benefit is being able to log all failures here
        console.log(error);
        return false;
      });
  };
}

export default promiseMiddleware;

import Immutable from 'immutable';

/*
 Here we use an Immutable List object to store our state
 (though a more complex app would probably have a more elaborate structure),
 and return a newly transformed version depending on the action.

 Redux isn’t very opinionated, and only has two expectations of its redeucers:
 1. The reducer has the signature (state, action) => newState.
 2. The reducer does not mutate the state it is given, but returns a new one
 */

const defaultState = new Immutable.List();

export default function todoReducer(state = defaultState, action) {
  switch (action.type) {
    case 'GET_TODOS':
      return new Immutable.List(action.res.data);

    case 'CREATE_TODO':
      return state.concat(action.res.data.text);

    case 'EDIT_TODO':
      return state.set(action.id, action.text);

    case 'DELETE_TODO':
      return state.delete(action.id);

    default:
      return state;
  }
}

